        public static UInt32 bswapl(UInt32 adrs)
        {
            //__asm {
            //mov eax, adrs
            //bswap eax
            //}
            return (adrs << 24) + ((adrs << 8) & 0xff0000) + ((adrs >> 8) & 0xff00) + (adrs >> 24);
        }

        public static ushort bswapw(ushort data)
        {
            //__asm {
            //mov ax, data
            //ror ax,8
            //}

            return (ushort)((data << 8) + (data >> 8));
        }

        public static int MemReadDefault(uint adrs)
        {
            if (memory.Length <= adrs) return -1;
            return memory[adrs];
        }

